import React from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import Profile from "./Profile";

const Home = () => (
  <div>
    <p className="has-text-weight-bold has-text-danger">Home page</p>
    <Router>
        <Routes>
            <Link to="/profile" className="button is-primary">Profile</Link>
            <button className="button is-link">Analysis</button>
            <button className="button is-info">Image processing</button>
            <Route path="/profile" component={Profile} />
        </Routes>
    </Router>
  </div>
);

export default Home;
